/*script for menus*/

$(function(){
        jQuery('#navlist>li').click(function (){$(this).find('ul').slideToggle('medium')});
});
$(function () {
    $('li.green').click(function(){
        $('#navlist li.green').not(this).each(function () {
            $(this).find('ul').css('display','none');
        });
    });
});


